function download_dump(){fetch("/download_dump").then(e=>e.blob()).then(e=>{const t=URL.createObjectURL(e);let n=document.createElement("a");n.href=t,n.download="statistics.db",document.body.appendChild(n),n.click(),document.body.removeChild(n)})}document.addEventListener("DOMContentLoaded",function(){const e=document.getElementById("show-btn-id");let t=document.getElementById("project-info-id");t.style.display="none",e.addEventListener("click",function(){let e=document.getElementById("project-info-id");"none"===e.style.display?e.style.display="block":e.style.display="none"});const n=document.getElementById("close-btn");n.addEventListener("click",function(){let e=document.getElementById("project-info-id");e.style.display="none"});const d=document.getElementById("list-of");d.selectedIndex=0;const o=document.getElementById("list-of"),c=document.getElementById("site-list");o.addEventListener("change",e=>{const t=e.target.value,n=`/process/${t}`;fetch(n).then(e=>e.text()).then(e=>{c.value=e}).catch(e=>console.error(e))})});